import React, { Component } from 'react';
import './App.css';

class MeuNome extends Component {
    render() {
    const usuario = {
        nome: this.props.name ,
        sobrenome: this.props.lastname
    }
        return <p> Ola meu nome é { usuario.nome } e sobrenome é { usuario.sobrenome } </p>;
    }
}
export default MeuNome;
